const PostsPageHeader = () => {
	return (
		<div className="h-16 bg-secondary w-full flex justify-between object-top">
			<h1 className="pl-4 py-1 font-bold text-primary text-5xl">Groupomania</h1>
			<ul className="flex flex-row font-bold text-4xl">
				<li className="pr-2">Profil</li>
				<li>Deconnexion</li>
			</ul>
		</div>
	);
};

export default PostsPageHeader;
